(32, 1, '2024-09-12 05:41:43', '2024-09-12 05:41:43', '<!-- wp:paragraph -->\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature.</p>\n<!-- /wp:paragraph -->', 'Hello Word 2', '', 'publish', 'open', 'open', '', 'hello-word-2', '', '', '2024-09-12 05:41:46', '2024-09-12 05:41:46', '', 0, 'http://localhost/softtech-it-class-50/?p=32', 0, 'post', '', 0),
